ERROR - 2023-12-12 12:06:43 --> Query error: You have an error in your SQL syntax; check the manual that corresponds to your MySQL server version for the right syntax to use near 'contribution. You also possess a good understanding of the sub-topic of Oppressi' at line 1 - Invalid query: REPLACE INTO t_nilai (tasm, jenis, id_guru_mapel, id_mapel_kd, id_siswa, nilai, catatan, catatan_mid) VALUES ('20231', 't', '2', '9', '', '', '', ''),('20231', 'a', '2', '9', '', '', '', ''),('20231', 'c', '2', '9', '', '0', '', ''),('20231', 'h', '2', '0', '', 'You already possess the ability to identify and understand conflict, gender inequality, and social injustice. Howeever, you need to improve more in  application especially in writing the explanation. Read more books and articles, watch more global news, and prcatice more in writing to strive your goals. I believe you can achieve a way better result in the future.', '', ''),('20231', 'h', '2', '0', '', 'You have improved on the topic of Global Conflict, and Gender Inequality. However, you should improve your understanding of topics of United Nations aid, Social Justice and Injustice, and oppression. With more effort exerted, I believe you can get better results, Adzra!', '', ''),('20231', 'h', '2', '0', '', '1', '', ''),('20231', 'h', '2', '0', '', '', '', ''),('20231', 't', '2', '9', '', '', '', ''),('20231', 'a', '2', '9', '', '', '', ''),('20231', 'c', '2', '9', '', '0', '', ''),('20231', 'h', '2', '0', '', 'You already possess the ability to identify and understand conflict, gender inequality, and social injustice. Howeever, you need to improve more in  application especially in writing the explanation. I believe you can achieve a way better result in the future.', '', ''),('20231', 'h', '2', '0', '', 'You have improved on the topic of Social Justice and Injustice and the Oppression To the Minority. However, you need to exert more effort to gain a better understanding of the topics of Global Conflicts, Conflict in the Community, and United Nations contributions. Read and write more articles to have better results on structured questions. Keep up the good work, Aretha!', '', ''),('20231', 'h', '2', '0', '', '3', '', ''),('20231', 'h', '2', '0', '', '', '', ''),('20231', 't', '2', '9', '', '', '', ''),('20231', 'a', '2', '9', '', '', '', ''),('20231', 'c', '2', '9', '', '0', '', ''),('20231', 'h', '2', '0', '', 'You already possess the ability to identify and understand conflict, gender inequality, and social injustice. Howeever, you need to improve more in  application especially in writing the explanation. Read more books and articles, watch more global news, and prcatice more in writing to strive your goals. I believe you can achieve a way better result in the future.', '', ''),('20231', 'h', '2', '0', '', 'You have shown slight improvement on the topic of Global Conflict. However you need to exert more effort on the topic of Social Justice and Injustice, the United Nations contributions, and Conflict in The Community. You will excel in the future if you practice more reading and writing articles. Boost the spirit, Syifa!', '', ''),('20231', 'h', '2', '0', '', '4', '', ''),('20231', 'h', '2', '0', '', '', '', ''),('20231', 't', '2', '9', '', '', '', ''),('20231', 'a', '2', '9', '', '', '', ''),('20231', 'c', '2', '9', '', '0', '', ''),('20231', 'h', '2', '0', '', 'You already possess the ability to identify and understand conflict, gender inequality, and social injustice. Howeever, you need to improve more in  application especially in writing the explanation. Read more books and articles, watch more global news, and prcatice more in writing to strive your goals. I believe you can achieve a way better result in the future.', '', ''),('20231', 'h', '2', '0', '', 'You have shown slight improvement on the topic of Global Conflict and United Nations contribution. However, you need to exert more effort in the topic of Social Justice and Injustice and Conflict in The Community. Practice reading and writing articles, Azka!', '', ''),('20231', 'h', '2', '0', '', '5', '', ''),('20231', 'h', '2', '0', '', '', '', ''),('20231', 't', '2', '9', '', '', '', ''),('20231', 'a', '2', '9', '', '', '', ''),('20231', 'c', '2', '9', '', '0', '', ''),('20231', 'h', '2', '0', '', 'You have shown a good understanding and skill of identification on every sub-topic such as conflict, gender inequality, and social injustice. Improve your writing skill to strive for better results in the future. Congratulations and keep up the good work!', '', ''),('20231', 'h', '2', '0', '', 'You have shown a good understanding of the topic of Conflict in the Community and Social Justice and Injustice. However, you need to improve more understanding of the topic of the United Nations Contributions, Global Conflict, and Gender Inequality. Practice more reading and writing articles to boost and better results in structured questions. Keep up the good work, Dizha!', '', ''),('20231', 'h', '2', '0', '', '6', '', ''),('20231', 'h', '2', '0', '', '', '', ''),('20231', 't', '2', '9', '', '', '', ''),('20231', 'a', '2', '9', '', '', '', ''),('20231', 'c', '2', '9', '', '0', '', ''),('20231', 'h', '2', '0', '', 'You are nice student in the class and try to coupe with the subject howeever you need a huge leap of actions to improve in every aspects. You may start by improving your English ability. Read more, listen more, speak more so you are able to understand and apply what the course requires.', '', ''),('20231', 'h', '2', '0', '', 'You have shown slight improvement on the topic of Global Conflict. However, you need to exert more effort on the topic of Social Justice and Injustice, the United Nations contributions, and Conflict in The Community. Be more engaged in class activities and contribute more to the team. You will excel in the future if you practice more reading and writing articles. Boost the spirit, Fathir!', '', ''),('20231', 'h', '2', '0', '', '7', '', ''),('20231', 'h', '2', '0', '